import React from 'react';
const Main = () => {
  const firstName = `Steven`;
  const lastName = `Yoh`
  return (
    <div className="main-home">
      <svg width="5000" height="2000" viewBox="0 0 5000 2000" fill="none" xmlns="http://www.w3.org/2000/svg">
<g id="backdrop" clip-path="url(#clip0)">
<path id="backdrop-solid" d="M10180.7 191.162H942.316V1764.52H10180.7V191.162Z" fill="#6C63FF"/>
<path id="backdrop-shadow" opacity="0.1" d="M3011.57 1764.52H942.316V191.162L3011.57 1764.52Z" fill="black"/>
</g>
<defs>
<clipPath id="clip0">
<rect width="5000" height="2000" fill="white"/>
</clipPath>
</defs>
</svg>

        <p>{firstName}</p>
        <p>{lastName}</p>
    </div>
  )
}

export default Main;
